import './statics/css/AppLogin.css'
import username_logo from './statics/images/username.svg'

var AppLogin = props=>{
    return (
        <div className="login">
            <div className="form">
                <h1 align='center'>Login</h1>
                <form method = 'POST'>
                    <input id='username' type="text" onLoad= {()=>{
                        console.log(this)
                        this.style.backgroundImage= username_logo}} placeholder = 'Username or Email' />
                    <input type="password"  id='password' placeholder= "Password" />
                    {/* <input className='login' type="submit"  value= 'Login' /> */}
                </form>
            </div>
        </div>
    )
}


export default AppLogin;
